import React, { Component } from "react";

import "./App.css";

export default class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Frankenstein",
          id: "asci",
        },
        {
          name: "Dracula",
          id: "ass1",
        },
        {
          name: "Zombie",
          id: "asrw",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => (
          <h1 key={monster.id}> {monster.name} </h1>
        ))}
      </div>
    );
  }
}
